(71, 'Hair Service', 'imageUrl-1642586012846.jpg', 'We are providing the different types of hair services.', '<p>We are providing the different types of hair services, Providing the hair services like <strong>Hair cutting Hair coloring Hair styling &nbsp;&nbsp;</strong>&nbsp;for our clients and customers. We have a team of hair stylists to provide these services.</p>\n<p>Our hair stylists is expert in hair saervices.</p>', 0, '/hair-service', 1, '2022-01-19 09:53:32', '2022-01-27 08:33:55'),
(72, 'Body Massage', 'imageUrl-1642597649048.png', 'Body massage is a structured and systematic procedure of applying tension, motion or vibration, with or without the application of heat.', '<p>We are providing the service of body massage in are salon.</p>\n<p>A body massage involves working and applying pressure on the muscles of the body, on the skin surface. It may be a manual massage or done with machines</p>', 0, '/', 0, '2022-01-19 13:07:29', '2022-01-27 07:33:09'),
(73, 'Hair Coloring', 'imageUrl-1642673991213.jpg', 'Hair coloring, is the practice of changing the hair color.', '<p>Hair coloring, or hair dyeing, is the practice of changing the hair color. The main reasons for this are cosmetic: to cover gray or white hair, to change to a color regarded as more fashionable or desirable, or to restore the original hair color after it has been discolored by hairdressing processes or sun bleaching.</p>', 71, '/hair-color', 0, '2022-01-20 10:19:51', '2022-01-21 08:48:22'),
(74, 'Full Body Massage', 'imageUrl-1642759837334.jpeg', 'A body massage involves working and applying pressure on the muscles of the body, on the skin surface.', '<p>In a full-body massage a therapist will massage the entire body during a therapeutic massage. Sessions typically last a minimum of 50 minutes which allows enough time&nbsp;to work over all the major areas of the body like the back, shoulders, legs, feet, arms,&nbsp;hands, and neck.</p>', 72, '/full-body-massage', 0, '2022-01-21 10:10:37', '2022-01-27 07:19:55'),
(76, 'adddsss', 'imageUrl-1643108829786.jpg', 'ssssssssssdfdfgghfhfgh', '<p>fdgggggggggggggggggggsdfdsssgfgdgfdg</p>', 75, '/add-demo-page', 1, '2022-01-25 11:07:09', '2022-01-25 11:43:35'),
(80, 'OurData-services', 'imageUrl-1643116252893.jpeg', 'OurData-services short OurData-services shortshortshort', '<p>OurData-services short OurData-services &nbsp;&nbsp;OurData-services short OurData-services &nbsp;LONGLONGLONGLONGLONGLONGLONGLONGLONG</p>', 0, '/ourData-services', 1, '2022-01-25 13:10:52', '2022-01-27 07:06:57'),
(81, 'subjs', 'imageUrl-1643123911284.jpg', 'subjssubjssubjssubjs short', '<p>LONG subjssubjssubjssubjssubjssubjs</p>', 0, '/subjs', 1, '2022-01-25 15:17:26', '2022-01-27 07:06:13'),
(82, 'abhinav-srevices', 'imageUrl-1643258721988.png', 'abhinav-srevices shortt description', '<p>LONG DESCRIPTION &nbsp;. . . . &nbsp;.abhinav-srevices</p>', 0, '/abhinav-srevices-sub-page', 1, '2022-01-27 04:45:21', '2022-01-27 07:06:11'),
