(306, 'Our_client', '/our-client', 'image-1642775977774.jpg', '<h2><u>&nbsp;OUR CLIENT</u></h2>\n<p><br></p>\n<figure><img src=\"data:image/jpeg;base64,\" height=\"auto\" width=\"auto\"/></figure>\n<p><br></p>\n<p><strong>orem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum</p>\n<p><br></p>', 0, '2022-01-18 05:18:24', '2022-01-21 14:39:37'),
(310, 'Home', '/home', 'image-1642776753784.jpg', '<p><em>Lorem ipsum</em>, or <em>lipsum</em> as it is sometimes known, is dummy text used in laying out print, graphic or web designs. The passage is attributed to an unknown typesetter in the 15th century who is thought to have scrambled parts of Cicero\'s <em>De Finibus Bonorum et Malorum</em> for use in a type specimen book. It usually begins with:</p>\n<blockquote><em>“Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.”</em></blockquote>\n<p>The purpose of <em>lorem ipsum</em> is to create a natural looking block of text (sentence, paragraph, page, etc.) that doesn\'t distract from the layout. A practice not without <a href=\"https://loremipsum.io/#controversy\" title=\"controversy\">controversy</a>, laying out pages with meaningless filler text can be very useful when the focus is meant to be on design, not content.</p>\n<p>The passage experienced a surge in popularity during the 1960s when Letraset used it on their dry-transfer sheets, and again during the 90s as desktop publishers bundled the text with their software. Today it\'s seen all around the web; on templates, websites, and stock designs. Use our <a href=\"https://loremipsum.io/#generator\" title=\"generator\">generator</a> to get your own, or read on for the authoritative history of <em>lorem ipsum</em>.</p>\n<figure><img height=\"auto\" src=\"https://c.neh.tw/thumb/f/720/643f31baf07f42bd9a92.jpg\" width=\"auto\"/></figure>', 0, '2022-01-19 10:35:25', '2022-01-21 14:52:33'),
(324, 'sadd', '/addd', 'image-1642776762080.jpeg', '<p>dsfsdfd</p>', 0, '2022-01-21 11:41:19', '2022-01-21 14:52:42'),
